import React from 'react';
import { View, Text, ImageBackground, StyleSheet, Image } from 'react-native';
import bgimage from '../assets/bg.webp';
import crop from '../assets/crop.jpg';

export default function Predict() {
  return (
    <ImageBackground
    source={bgimage}
    style={styles.backgroundImage}
  >
  <View className="flex w-screen flex-row items-center justify-center m-0 p-0">
    <Image source={crop} className="rounded-b-3xl h-full w-full m-0 p-0" style={styles.cropimg}/>
    <View className="flex w-3/4 flex-row items-center justify-between m-0 p-0 rounded-2xl" style={styles.rec}>

    </View>
  </View>
  </ImageBackground>
  );
}


const styles = StyleSheet.create({
  backgroundImage: {
    flex: 1,
    resizeMode: 'cover',
    paddingHorizontal: 30,
    alignItems: "center"
  },
  cropimg: { 
    height: 380,
    resizeMode:"cover"
  },
  rec:{
    height:80,
    backgroundColor: "#F3EEEAA0",
    position:"absolute",
  }
});
